      const boundingBox = new Box3().setFromObject(skyBox);

      // Obtiene las coordenadas de las esquinas del bounding box
      const min = new Vector2(viewmodel.convertX(boundingBox.min.x), viewmodel.convertY(boundingBox.min.z));
      const max = new Vector2(viewmodel.convertX(boundingBox.max.x), viewmodel.convertY(boundingBox.max.z));

