/*
 * Change floor and wall textures and adjust wall height
 */

var WallAndFloorSelector = function (blueprint3d, sideMenu) {
  var scope = this;
  var three = blueprint3d.three;
  var isAdmin = isAdmin;
  this.floorPlanner = blueprint3d.floorplanner;
  var currentTarget = null;
  function initSelectors() {
    client_$(".texture-select-thumbnail").on('click', function (e) {
      var textureUrl = client_$(this).attr("texture-url");
      var textureStretch = client_$(this).attr("texture-stretch") == "true";
      var textureScale = parseInt(client_$(this).attr("texture-scale"));
      currentTarget.setTexture(textureUrl, textureStretch, textureScale);
      e.preventDefault();
    });
  }
  function init() {
    three.wallClicked.add(wallClicked);
    three.floorClicked.add(floorClicked);
    three.itemSelectedCallbacks.add(reset);
    three.nothingClicked.add(reset);
    sideMenu.stateChangeCallbacks.add(reset);

    //Se agrega el evento para el control de altura de los muros
    client_$("#actual-wall-height").on('change', updateWallsHeight);
    client_$("#actual-floor-height").on('change', updateFloorHeight);
    client_$("#transparent-floor").on('change', transparent);
    initSelectors();
  }
  function wallClicked(halfEdge) {
    currentTarget = halfEdge;
    client_$("#floorTexturesDiv").hide();
    client_$("#actual-wall-height").val(halfEdge.height);
    // Recoge tambien el boton de altura
    client_$("#wallTextures").show();
  }
  function floorClicked(room) {
    currentTarget = room;
    client_$("#transparent-floor").val(room.transparence);
    client_$("#wallTextures").hide();
    client_$("#actual-floor-height").val(room.altitude);
    client_$("#floorTexturesDiv").show();
  }

  // Si el suelo es visible lo vuelve transparente, si no, lo vuelve opaco para que vuelva a ser visible
  function transparent() {
    const room = currentTarget;
    const floorplan = three.getModel().floorplan;
    const transparence = client_$("#transparent-floor").val();

    // Cambia la transparencia de el suelo de la habitacion
    floorplan.changeRoomTransparency(room, transparence);
    // Actualiza el plano
    floorplan.update();
  }
  function reset() {
    client_$("#wallTextures").hide();
    client_$("#floorTexturesDiv").hide();
  }

  //Funcion que actualiza la altura de los muros
  function updateWallsHeight() {
    // Obtengo el muro seleccionado (ya que se selecciona un half edge)
    const wall = currentTarget.wall;
    const floorplan = three.getModel().floorplan;

    // Se obtiene la altura que se quiere cambiar desde el boton
    let height = parseFloat(client_$("#actual-wall-height").val());

    // Control de valores minimos
    if (height < 0) {
      height = 0;
      client_$("#actual-wall-height").val(0);
    }

    // Se cambia la altura a los half edges que tenga el muro
    if (wall.frontEdge) wall.frontEdge.height = height;
    if (wall.backEdge) wall.backEdge.height = height;

    // Finalmente se le cambia la altura al muro
    wall.setWallHeight(height);

    // Se pide que se actualice el plano de suelo (los muros y suelos en general)
    floorplan.update();
  }
  function updateFloorHeight() {
    const room = currentTarget;
    const floorplan = three.getFloorPlan().floorplan;
    let altitude = parseFloat(client_$("#actual-floor-height").val());
    floorplan.changeRoomAltitude(room.getUuid(), altitude);
  }
  init();
};

/*
 * Floorplanner controls
 */

var ViewerFloorplanner = function (blueprint3d) {
  var canvasWrapper = '#floorplanner';

  // buttons
  var move = '#move';
  var remove = '#delete';
  var draw = '#draw';
  var activeStlye = 'btn-primary disabled';
  this.floorplanner = blueprint3d.floorplanner;
  var scope = this;
  function init() {
    client_$(window).on('resize', scope.handleWindowResize);
    scope.handleWindowResize();

    // mode buttons
    scope.floorplanner.modeResetCallbacks.add(function (mode) {
      client_$(draw).removeClass(activeStlye);
      client_$(remove).removeClass(activeStlye);
      client_$(move).removeClass(activeStlye);
      if (mode == scope.floorplanner.modes.MOVE) {
        client_$(move).addClass(activeStlye);
      } else if (mode == scope.floorplanner.modes.DRAW) {
        client_$(draw).addClass(activeStlye);
      } else if (mode == scope.floorplanner.modes.DELETE) {
        client_$(remove).addClass(activeStlye);
      }
      if (mode == scope.floorplanner.modes.DRAW) {
        client_$("#draw-walls-hint").show();
        scope.handleWindowResize();
      } else {
        client_$("#draw-walls-hint").hide();
      }
    });
    client_$(move).on('click', function () {
      scope.floorplanner.setMode(scope.floorplanner.modes.MOVE);
    });
    client_$(draw).on('click', function () {
      scope.floorplanner.setMode(scope.floorplanner.modes.DRAW);
    });
    client_$(remove).on('click', function () {
      scope.floorplanner.setMode(scope.floorplanner.modes.DELETE);
    });
  }
  this.updateFloorplanView = function () {
    scope.floorplanner.reset();
  };
  this.handleWindowResize = function () {
    client_$(canvasWrapper).height(window.innerHeight - client_$(canvasWrapper).offset().top);
    scope.floorplanner.resizeView();
  };
  init();
};
